INSERT INTO `products` (`product_id`, `product_cat`, `product_brand`, `product_title`, `product_price`, `product_desc`, `product_image`, `product_keywords`, `fecha`, `peso`) VALUES
(40, '1', '1', 'Cafe', '15.00', 'Cafe con leche, agua y azucar', 'cafe.jpg', 'se pone a herver agua durante 10min y se le echa cafe. ', '2020/12/12 10:06:19 pm', 1),
(41, '1', '1', 'Tostadas', '25.00', 'pan, jamon o pabo ', 'tostada.jpg', 'Se calienta el pan y luego se pone la preparacion', '2020/12/12 10:09:36 pm', 1),
(42, '1', '1', 'Jugo de naranja', '10.00', 'Agua, Azucar y Naranjas', 'jugo.png', 'Se esprimen las naranjas en un resipiente y luego se le echa azucar', '2020/12/12 10:13:16 pm', 1),
(43, '1', '1', 'Tortitas De Avena', '28.00', '5 cucharadas de harina de avena\r\n100 g de fresas\r\n75 ml de leche vegetal\r\n2 cucharadas de miel\r\n½ cucharadita de levadura\r\n2 cucharadas de azúcar moreno\r\ncanela\r\n1 huevo\r\n2 plátanos\r\nsal\r\n½ cucharadita de esencia de vainilla\r\nmantequilla', 'tortas.jpg', 'Casca el huevo en un bol y bátelo junto con el azúcar. Añade la leche y mezcla. Tamiza encima la harina con la levadura, la canela y una pizca de sal. Pela los plátanos. Aplasta uno de ellos con un tenedor y añádelo al bol. Aromatiza con la vainilla. Bate hasta conseguir una crema homogénea', '2020/12/12 10:17:03 pm', 1),
(45, '2', '1', 'Yogur con Frutas', '54.00', ' yogur desnatado y fruta de tu gusto (plátanos, mangos, piña, etc.', 'yogurt.jpg', 'Mesclar tus fruts favoritas al yogut', '2020/12/12 10:22:11 pm', 1),
(46, '3', '1', 'Ensalada de pollo', '25.00', '1 unidad de filete de pechuga de pollo\r\n1 taza de cuscús\r\n1 puñado de aceitunas verdes\r\n1 trozo de queso feta\r\n1 pizca de sal y pimienta\r\n1 pizca de orégano\r\n1 chorro de aceite\r\n1 manojo de perejil\r\n1 diente de ajo', 'ensalada-de-pollo.jpg', 'Prepara el cuscús, para esto basta con que sigas las indicaciones del fabricante, reserva.\r\nElabora el marinado (aceite, sal, pimienta y orégano seco) y reserva.\r\nMarina la pechuga, espera al menos 3 horas, procede a córtala en tiras, reserva.\r\nCocina el pollo a la plancha, bien hecho, sin aceite y reserva.\r\n', '2020/12/12 10:26:24 pm', 1),
(47, '3', '1', 'Filete de pollo', '15.00', '2 filetes de pechuga de pollo\r\n1 Limón\r\n1 pizca de pimienta\r\n1 diente de ajo\r\n1 pizca de orégano\r\n1 pizca de hierbas provenzales', 'filete.jpg', 'Prepara el marinado para el pollo, utiliza: limón o vinagre de manzana, el ajo (finamente picado) y las especies.\r\nMezcla muy bien todos los ingredientes, hasta lograr homogeneidad, y reserva. El marinado proporciona sabor a la carne, jugosidad y suavidad.', '2020/12/12 10:29:14 pm', 1),
(48, '3', '1', 'Ensalada de atún', '58.00', '1 cabeza de lechuga\r\n3 unidades de aguacate\r\n150 gramos de maíz\r\n2 latas de atún en agua o aceite de oliva\r\n1 Limón\r\n2 cebollas', 'atun.jpg', 'Lava muy bien la lechuga, pícala con las manos y reserva.\r\nCorta la cebolla a la juliana y el ajo finamente picado, reserva ambos.\r\nPela, retira la semilla, pica el aguacate y reserva.', '2020/12/12 10:31:25 pm', 1),
(49, '3', '1', 'Jugo de naranja', '87.00', 'Naranjas,agua y azucar', 'jugo.png', 'se esprimen en un resipiente y se echa azucar', '2020/12/12 10:32:40 pm', 1),
(50, '4', '1', 'mini-sándwich', '54.00', ' Pan,jamón de pollo y pepino y acompañarlo con una taza de té verde.', 'sand.jpg', 'Para preparar el mini-sándwich, simplemente hay que coger la rebanada de pan integral y añadirle una rodaja de tomate y pepino. Después, se coloca la loncha de jamón de pollo y se corta el pan el cuadraditos. ', '2020/12/12 10:34:54 pm', 1),
(51, '4', '1', 'Manzana con manteca', '28.00', 'Mnzana y manteca de cacaguate', 'manzana.jpg', 'se asen las piezas de manzana pequeñas y de les pone manteca ensima', '2020/12/12 10:37:19 pm', 1),
(52, '5', '1', 'Ensalada De verd.', '2.00', 'tomate,lechuga,mayoneza', 'ensalaad.jpg', 'de pica en un resipiente', '2020/12/12 10:39:44 pm', 1),
(53, '5', '1', 'Jugo de manzana', '8.00', 'Mnzanas y azucar', 'Manzanas.jpg', 'se licuan las manzanas', '2020/12/12 10:41:38 pm', 1),
(60, '1', '1', 'leche desnatada', '8.00', 'leche ', 'leche.jpg', 'solo leche cun una pieza de pruta', '2020/12/14 08:55:09 pm', 3),
(61, '1', '1', 'Café', '7.00', 'cafe y agua ', 'cafe2.png', 'se herve el agua y se le echa el cafe no azucar', '2020/12/14 08:57:33 pm', 3),
