(81, '3', '1', 'Filete de pollo', '89.00', '2 filetes de pechuga de pollo 1 Limón 1 pizca de pimienta 1 diente de ajo 1 pizca de orégano 1 pizca de hierbas provenzales', 'filete.jpg', 'Prepara el marinado para el pollo, utiliza: limón o vinagre de manzana, el ajo (finamente picado) y las especies. Mezcla muy bien todos los ingredientes, hasta lograr homogeneidad, y reserva. El marinado proporciona sabor a la carne, jugosidad y suavidad.', '2020/12/14 10:28:25 pm', 2),
(82, '3', '1', 'Omelette Caprese', '7.00', 'huevo,queso magro,tomate ,albahaca,zanahoria', 'Omelette Capresse.jpg', 'con 1 yema + 2-3 claras o solo claras + 1 feta de queso magro + tomate y albahaca. Puede acompañar con ensalada repollo y zanahoria.', '2020/12/14 10:31:51 pm', 2),
(83, '3', '1', 'Jugo de naranja', '10.00', 'naranjas y azucar', 'jugo.png', 'se esprimen 3 naranjas y se echa azucar', '2020/12/14 10:32:57 pm', 2),
(84, '4', '1', 'mini-sándwich', '7.00', 'Pan,jamón de pollo y pepino y acompañarlo con una taza de té verde.', 'sand.jpg', 'Para preparar el mini-sándwich, simplemente hay que coger la rebanada de pan integral y añadirle una rodaja de tomate y pepino. Después, se coloca la loncha de jamón de pollo y se corta el pan el cuadraditos.', '2020/12/14 10:37:11 pm', 2),
(85, '4', '1', 'Pan Con queso', '18.00', 'pan y queso o crema', 'panyqueso.jpeg', '2 porciones de pan y crema', '2020/12/14 10:41:26 pm', 2),
(86, '4', '1', 'leche desnatada', '16.00', 'leche ', 'leche.jpg', 'leche desnatada con poca azucar', '2020/12/14 10:42:25 pm', 2),
(87, '5', '1', 'Huevos y verduras', '36.00', 'huevos verduras como papas tomates ', 'huevo.jpg', 'se mezclan las verduras con el huevo picado', '2020/12/14 10:45:02 pm', 2),
(88, '5', '1', 'Cafe', '9.00', 'unas cucharadas de cafe y azucar ', 'cafe2.png', 'una taza de cafe y poca azucar', '2020/12/14 10:45:59 pm', 2),
(89, '5', '1', 'Ensalada de atún', '10.00', '1 cabeza de lechuga 3 unidades de aguacate 150 gramos de maíz 2 latas de atún en agua o aceite de oliva 1 Limón 2 cebollas', 'atun.jpg', 'Lava muy bien la lechuga, pícala con las manos y reserva. Corta la cebolla a la juliana y el ajo finamente picado, reserva ambos. Pela, retira la semilla, pica el aguacate y reserva.', '2020/12/14 10:48:16 pm', 2),
(90, '2', '1', 'Yogur d. con frutas ', '13.00', 'yogur desnatado y frutas', 'yogurtconfrutas.jpg', 'se mezclan las frutas con el yogut desnatado', '2020/12/14 10:50:21 pm', 1),
(91, '1', '1', 'Coctel de frutas', '81.00', 'manzana,fresa,uvas', 'coctel.jpg', 'en en resipiente se pican todas las frutas', '2020/12/14 10:53:51 pm', 2);

