INSERT INTO `tabla_imagen` (`id`, `nombre`, `informacion`, `link`, `imagen`) VALUES
(20, 'Receta de Tortitas de pavo y champiñones', 'Pica los ajos frescos y los sombreros de los champiñones finamente. Sazona y ponlos a rehogar en una sartén con aceite. Pica el pavo en taquitos y añádelos. Saltea brevemente.  Añade el pavo y los champiñones a la masa y mezcla bien. Calienta una sartén con unas gotas de aceite. Agrega una cucharada hermosa de masa dentro de un cortapastas redondo. Cuájala durante unos 2-3 minutos por cada lado. Repite el proceso con el resto de la masa.  Pica los dientes de ajo y la cebolleta y ponlos a pochar en un cazo con un chorro de aceite. Agrega la cayena y los tallos de los champiñones picados. Sazona. Rehógalos bien. Vierte el vino y dale un hervor. Añade el pan frito y 200 ml. de agua. Cocina todo durante 10 minutos, retira la cayena, tritura y espolvorea con perejil picado.', 'https://www.youtube.com/', );
INSERT INTO `tabla_imagen` (`id`, `nombre`, `informacion`, `link`, `imagen`) VALUES
(23, 'ECETAS DE CARNE ASADA PARA CONSENTIR A PAPÁ EN SU DÍ    ', 'l Día del Padre está muy cerca, y seguramente quieres sorprenderlo con una comida súper especial y deliciosa. Las parrilladas siguen siendo las consentidas para tal evento, y nada mejor que una carne asada para consentirlo como se merece.\r\n\r\nPor eso traemos para ti estas 10 recetas de carne asada, perfectas para disfrutarlas en un día al aire libre y que papá, además de comer delicioso, se divierta y disfrute de su familia. ¡Se convertirá en el rey del grill!', 'https://www.google.com/search?q=ghost&oq=gho&aqs=chrome.1.69i57j0j46l2j0j46j0j46.1986j0j7&sourceid=chrome&ie=UTF-8     ', );
INSERT INTO `tabla_imagen` (`id`, `nombre`, `informacion`, `link`, `imagen`) VALUES
(26, 'Dieta equilibrada: menús equilibrados para perder peso y reducir grasa      ', 'Para perder peso y llevar una dieta equilibrada, Carlos Aznar Gallego, nutricionista, nos recomienda alimentos esenciales y nos aclara varias dudas sobre el picoteo entre horas o la cantidad de comidas que debemos realizar al día.\r\n\r\n¿Cuáles son las claves de una dieta equilibrada?;Perder peso, el objetivo\r\n¿Qué alimentos son básicos en una dieta equilibrada para contribuir a la pérdida de grasa y peso? Controla tu IMC\r\n¿Qué alimentos NO son recomendables incluir en las dietas para adelgazar y por qué?\r\nTrucos para perder peso y llevar una dieta equilibrada\r\n¿Es conveniente picar entre horas? ¿Depende del tipo de alimentos?\r\n¿Cuántas comidas recomiendas realizar al día?', 'https://www.youtube.com/      ', );

